import React from 'react'
import './Services.css'
import Grid from '@mui/material/Grid';



function Services() {
    return (
        <Grid container spacing={2} columns={16}>
            <Grid item xs={8}>
                <Item>xs=8</Item>
            </Grid>
            <Grid item xs={8}>
                <Item>xs=8</Item>
            </Grid>
        </Grid>
    )
}

export default Services
